import React from 'react'
import { CircularProgressbar, buildStyles  } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

function Skills_card(props) {
    return (
        <div className="skill_box">
            {/* <button className='btn_shadow skill_btn' title={props.title}>
                {props.icon}
            </button> */}
            <CircularProgressbar
                value={props.percentage}
                text={`${props.percentage}%`}
                circleRatio={1}
                styles={buildStyles({
                    rotation: 0.25,
                    strokeLinecap: 'butt',
                    textSize: '16px',
                    pathTransitionDuration: 1,
                    pathColor: `rgba(62, 152, 199, ${props.percentage / 100})`,
                    textColor: '#f88',
                    trailColor: '#d6d6d6',
                    backgroundColor: '#9j9j9j',
                })} />;
                <p style={{"textAlign": "center", "color":"white"}}> {props.name} </p>
        </div>
    )
}

export default Skills_card
